import "../../css/command.css";
import portrait from "../../images/portrait.png";

const About = () => {
  return (
    <div className="command">
      <h3>About</h3>
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "2",
          gridTemplateRows: "1",
        }}
      >
        <div style={{ gridColumn: 1, gridRow: 1 }}>
          <p>
            I am an aspiring software developer looking for a job that i dont
            hate so i dont have to work in the restaurant industry anymore
            please hire me thank you
          </p>
        </div>
        <div style={{ gridColumn: "1fr 1fr", gridRow: 1 }}>
          <img src={portrait} alt="self portrait" />
        </div>

        {/* prettier-ignore */}

        <pre>

      </pre>
      </div>
    </div>
  );
};

export default About;
